import React, { Component } from "react";
import ReactPlayer from "react-player";

import Title from "./Title";
import AbstractText from "../Data/AbstractText";
import diagram from "../resources/systems diagram.png";
import "../styles/Abstract.css";

//view the movies

class Abstract extends React.Component {
  render() {
    return (
      <div>
        <Title text="Movies database"></Title>

        <div className="Body">
          <div className="introduction">
            <h2>Introduction</h2>
            <p>{AbstractText["introduction"]}</p>
          </div>

          <div className="diagram">
            <h2>System Diagram</h2>
            <p>{AbstractText["system"]}</p>
            <img src={diagram} />
          </div>

          <div className="video">
            <h2>Demo video</h2>
            <p>{AbstractText["video"]}</p>
            <ReactPlayer url="https://youtu.be/3FhPsjFLhkk" />
          </div>

          <div className="project2">
            <h2>Second Project</h2>
            <p>{AbstractText["project2"]}</p>
          </div>
        </div>
      </div>
    );
  }
}

let movies = FrontEndText["features"].map(feature => (
    <li>{feature}</li>
))

export default Abstract;
